import $ from 'jquery';


const Contact = () => {
  console.log("haha");
  
    $( "li" ).on( "click", function() {
      for (let i = 0; i < 15; i++) {
        document.querySelectorAll("li")[i].style.backgroundColor = "black";
      }
      console.log("hahahahahahaha");
      this.style.backgroundColor = "#272727";
    } );
    return <h1>Contact Me</h1>;
  };
  
  export default Contact;
